INSERT INTO `penyakits` (`id`, `kode_penyakit`, `name`, `desc`, `penanganan`, `gambar`, `created_at`, `updated_at`) VALUES
(3, 'P01', 'Ringworm', 'Ringworm atau yang dikenal sebagai dermatofitosis, merupakan infeksi jamur \r\npada lapisan superfisial kulit yang terutama menyerang jaringan berkeratin, seperti stratum korneum, rambut, dan kuku. Penyakit ini disebabkan oleh jamur dari kelompok dermatofita dan dapat menular tidak hanya pada berbagai jenis hewan, tetapi juga pada manusia.', 'Mengkarantina kucing yang terkena penyakit. Melakukan disinfeksi terhadap lingkungan sekitar kucing seperti kandang dan tempat tidur kucing. Disinfektan yang dapat dipakai antara lain Sodium Hypochlorite, formail dan amonium. Gunakan pakaian pelindung atau sarung tangan saat menangani kucing', '', '2025-05-02 09:37:14', '2025-05-06 10:41:39');
INSERT INTO `penyakits` (`id`, `kode_penyakit`, `name`, `desc`, `penanganan`, `gambar`, `created_at`, `updated_at`) VALUES
(4, 'P02', 'Scabies', 'Scabies, atau skabies, adalah penyakit kulit yang umum terjadi pada kucing, \r\nbaik yang dipelihara maupun yang hidup liar. Penyakit ini disebabkan oleh infestasi tungau Sarcoptes scabiei, yang bersifat zoonosis, sehingga dapat menular ke manusia.', 'Mengkarantina kucing yang terkena penyakit. Melakukan disinfeksi terhadap lingkungan sekitar kucing seperti kandang dan tempat tidur kucing. Gunakan pakaian pelindung atau sarung tangan saat menangani kucing. Pemberian Benzoas bensilikus 10% dapat dioleskan pada luka', '', '2025-05-02 09:39:26', '2025-05-06 10:42:05');
INSERT INTO `penyakits` (`id`, `kode_penyakit`, `name`, `desc`, `penanganan`, `gambar`, `created_at`, `updated_at`) VALUES
(5, 'P03', 'Helminthiasis', 'Helminthiasis adalah penyakit yang menyerang sistem gastrointestinal pada \r\nkucing dan disebabkan oleh infeksi cacing. Penyakit ini dapat berdampak serius pada kesehatan kucing karena mengganggu fungsi pencernaan, yang jika dibiarkan dalam jangka panjang, dapat berkembang menjadi masalah sistemik dan mempengaruhi organ lain dalam tubuh.', 'Jaga kebersihan tempat makan dan tempat tidur kucing. Pemberian obat cacing antara lain Drontal, Lapatol dan antibiotik Amcilin atau Amoxcillin dengan dosis 10-15 mg/kg BB. Pastikan kucing tidak terpapar tikus atau hewan lain yang dapat membawa cacing.', NULL, '2025-05-02 09:43:05', '2025-05-03 03:30:12'),
(6, 'P04', 'Otitis', 'Otitis merupakan kondisi peradangan pada telinga kucing yang dapat \r\ndikategorikan berdasarkan lokasi terjadinya peradangan, yaitu otitis eksterna, otitis media, dan otitis interna. Otitis eksterna terjadi pada saluran telinga bagian luar, sedangkan peradangan yang terjadi di bagian tengah disebut otitis media, dan jika peradangan mencapai bagian dalam telinga, maka disebut otitis interna. Penyakit ini dapat disebabkan oleh infeksi jamur, parasit, atau bakteri, yang memicu reaksi inflamasi pada telinga', 'Pemberian Apex Ear Drops, Oil palm coconut, Ivermectin dana ntibiotik Amcilin atau Amoxcillin. Hindari memasukkan benda ke dalam telinga, hanya gunakan kapas untuk membersihkan bagian luar.', '', '2025-05-02 09:44:17', '2025-05-06 10:42:28'),
(7, 'P05', 'Ankilostomiasis', 'Ankilostomiasis adalah penyakit yang disebabkan oleh infeksi cacing Ancylostoma sp. Gejala utama dari infeksi ini adalah diare berdarah, akibat cacing dewasa yang menghisap darah dalam jumlah 0,1–0,8 ml per hari. Kucing yang terinfeksi biasanya mengalami penurunan berat badan, tubuh yang tampak kurus, dan dalam beberapa kasus dapat disertai muntah', 'Pemberian Fenbendazole dengan dosis 50mg/kg BB perhari selama 3 hari berturut-turut, Pyrantel Pamoate dosis 20-30 mg/kg BB, Ivermectin dosis 6mg/kg BB . Pastikan kucing mendapatkan cairan yang cukup untuk menghindari dehidrasi akibat diare. Bersihkan tempat tidur kucing dan area sekitarnya', NULL, '2025-05-02 09:46:01', '2025-05-05 21:28:57'),
(8, 'P06', 'Enteritis', 'Enteritis adalah penyakit yang ditandai dengan peradangan pada mukosa \r\nsaluran pencernaan, yang menyebabkan gangguan fungsi pencernaan. Kondisi ini \r\ndapat mengakibatkan peningkatan peristaltik usus dan sekresi pencernaan, sementara kapasitas gastrointestinal serta retensi nutrisi menurun. Akibatnya, kucing yang terinfeksi biasanya menunjukkan gejala klinis seperti buang air besar yang tidak normal. Beberapa tanda umum enteritis meliputi diare, muntah, dan keluarnya cairan \r\ndari hidung.', 'Pemberian antibiotik seperti Amcilin dan Amoxicillin, Kaopectate, Tribactral dan Metronidazole. Hindari memberi makanan berat atau berlemak sampai gejala membaik.', NULL, '2025-05-02 09:46:54', '2025-05-05 21:28:33'),
(9, 'P07', 'Toksokariasis', 'Toksokariasis adalah penyakit yang disebabkan oleh infeksi cacing Toxocara \r\nsp., dengan Toxocara cati sebagai spesies yang dapat menginfeksi kucing. Infeksi ini tidak hanya berbahaya bagi kucing sebagai inangnya, tetapi juga berpotensi menular ke manusia, menjadikannya sebagai penyakit zoonosis. Penularan pada manusia dapat terjadi apabila secara tidak sengaja menelan telur Toxocara yang bersifat infektif, yang biasanya terdapat di tanah atau kotoran kucing.', 'Jaga kebersihan tempat makan dan tempat tidur kucing. Pemberian obat cacing antara lain Drontal, Lapatol dan antibiotik Amcilin atau Amoxcillin dengan dosis 10-15 mg/kg BB. Pastikan kucing tidak terpapar tikus atau hewan lain yang dapat membawa cacing.', NULL, '2025-05-02 09:47:50', '2025-05-05 21:28:17');
INSERT INTO `penyakits` (`id`, `kode_penyakit`, `name`, `desc`, `penanganan`, `gambar`, `created_at`, `updated_at`) VALUES
(10, 'P08', 'Vulnus', 'Luka atau vulnus adalah kondisi di mana terjadi kerusakan atau hilangnya \r\nsebagian jaringan tubuh. Ketika luka muncul, berbagai dampak dapat terjadi, seperti gangguan fungsi organ secara parsial atau total, respons stres simpatis, perdarahan yang diikuti dengan proses pembekuan darah, serta risiko kontaminasi bakteri yang dapat menyebabkan kematian sel. Dalam konteks kucing, vulnus dapat dikategorikan menjadi beberapa jenis, seperti vulnus morsum (luka akibat gigitan), vulnus laceratum (luka robek), dan lain-lain.', 'Bersihkan luka dengan antiseptik ringan untuk mencegah infeksi. Cegah kucing menjilat luka dengan menggunakan collar pelindung atau pelindung tubuh.', '', '2025-05-02 09:49:47', '2025-05-06 10:42:56');
INSERT INTO `penyakits` (`id`, `kode_penyakit`, `name`, `desc`, `penanganan`, `gambar`, `created_at`, `updated_at`) VALUES
(11, 'P09', 'Toksoplasmosis', 'Toksoplasmosis adalah penyakit zoonosis yang disebabkan oleh protozoa Toxoplasma gondii. Parasit ini \r\nmemiliki kemampuan menginfeksi berbagai jenis burung dan mamalia, termasuk manusia, namun hanya kucing dan hewan sejenisnya yang berperan sebagai hospes definitif. Penyebaran Toxoplasma gondii dapat terjadi melalui konsumsi daging yang mengandung kista, terutama daging babi dan kambing, penularan transplasental pada wanita hamil, serta melalui ingestsi ookista infektif yang berasal dari kotoran kucing.', 'Pemberian Sulphadiazine atau Triple Sulphonamide dengan dosis 60 mg/kg BB selama 4-6 hari. Pemberian Pyrimethamine dengan dosis 0.5-1.0 mg/kg BB setiap hari selama 2 minggu. Jaga kebersihan rumah dan hindari kucing dari kotoran atau benda yang terkontaminasi.', NULL, '2025-05-02 09:50:48', '2025-05-05 21:27:36');
